import React, { useEffect, useState } from 'react'
import GoogleIcon from '@mui/icons-material/Google';
import p2 from "./p4.jpg"
import p9 from "./p9.png"
import "./Favourite.css"
import { CloudUploadFill,X, ChatDots,PencilSquare,Trash} from 'bootstrap-icons-react';
import Comment from "./Comment.jsx"

import {auth,provider}  from "../Login/Config.js"
import {signInWithPopup} from "firebase/auth"
import Home from "../Home/Home.js"

import Login from '../Login/Login.js';
import { ChatFill, ChatLeftDots} from 'bootstrap-icons-react';

import { } from 'bootstrap-icons-react';
const api_base = "http://localhost:3010";
const timestamp = 167822137944;
const date = new Date(timestamp);
/* eslint-disable */console.log(...oo_oo(`32cf8de7_0`,typeof timestamp))
const Favourite = () => {
  const [todos, setTodos] = useState([]);
  const [popupActive, setPopupActive] = useState(false);
  const [date,setDate]=useState("")
  const [value,setValue] = useState('')
  const [newAuthor,setAuthor]=useState("")
  const [popupActiveu, setPopupActiveu] = useState(false);
  const [url,setUrl]=useState('')

  const [updates,setupdates]=useState("")


  const update = async(id)=>

  {
  
    
    const data = await fetch(api_base + "/todo/update/" + id, {
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        text: updates, // the updated text
      }),
    }).then((res) => res.json());
    
    // handle the response data
    if (data.error) {
      // handle error
    } else {
      // update the todo item in the UI
      const updatedTodos = todos.map(todo => {
        if (todo._id === id) {
          // replace the old todo with the updated one
          return data;
        } else {
          return todo;
        }
      });
    setupdates("")
    setDate("");
      setTodos(updatedTodos);
      setPopupActiveu(false);
    }
    
  
  }
  const handleClick =()=>{
   
    alert("clicked")
    signInWithPopup(auth,provider).then(
      (user)=>{
        /* eslint-disable */console.log(...oo_oo(`32cf8de7_1`,user))
          localStorage.setItem("user",JSON.stringify(user))
          localStorage.setItem("email",user.user.email)
          setValue(user.user.email)
          
          setAuthor(user.user.displayName)
    setUrl(user.user.photoURL)


       
      }
  ).catch((e)=>console.log()) 
  
  
     
  }



  //create new todo
  const [newTodo, setNewTodo] = useState("");
  const [user,setuser]=useState("")
 
 
  // on mountdidmount change effect
  //e.target.files is an array

  useEffect(() => {
    GetTodos();
    async function fetchTodos() {
      const response = await fetch('/todos');
      const data = await response.json();
      setTodos(data);
    }
    fetchTodos();
  }, []);
  const GetTodos = () => {
    //pass the json string
    //console.log("here1")
    fetch("http://localhost:3010/todos")
      .then((res) => res.json())
      .then((data) => setTodos(data))
      .catch((err) => console.error("Error: ", err));
  };
  const deleteTodo = async (id) => {
    const data = await fetch( "http://localhost:3010/todo/delete/" + id, {
      method: "DELETE",
    }).then((res) => res.json());

    setTodos((todos) => todos.filter((todo) => todo._id !== data.result._id));
  };
 

  
  const addTodo = async () => {
    const data = await fetch("http://localhost:3010/todo/new", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        text: newTodo,
        author:newAuthor
      }),
    }).then((res) => res.json());

    setTodos([...todos, data]);
setupdates('')
    setPopupActive(false);
    setNewTodo("");
    
  };
  const [image, setImage] = useState("");
  const [allImage, setAllImage] = useState([]);
  
  function covertToBase64(e) {
    //console.log(e.target.files[0]);
    var reader = new FileReader();
    reader.readAsDataURL(e.target.files[0]);
    reader.onload = () => {
       // console.log(reader.result); //base64encoded string  
        setImage(reader.result);
    };
    reader.onerror = error => {
        /* eslint-disable */console.log(...oo_oo(`32cf8de7_2`,"Error: ", error));
    };
}


useEffect(()=>{
  getImage()

},[allImage])
function getImage() {
 // console.log("called");
  fetch("http://localhost:3010/get-image", {
    method: "GET",
  })
    .then((res) => {
      //console.log("response headers:", res.headers);
      return res.json();
    })
    .then((data) => {
     // console.log("getImage data:", data);
      setAllImage(data.data);
    })
    .catch((error) => {
      console.error(error);
    });
}


function uploadImage() {


  /* eslint-disable */console.log(...oo_oo(`32cf8de7_3`,"clicked"))
  fetch("http://localhost:3010/upload-image", {
      method: "POST",
      crossDomain: true,
      headers: {
          "Content-Type": "application/json",
          Accept: "application/json",
          "Access-Control-Allow-Origin": "*",
      },
      body: JSON.stringify({
          base64: image
      })
  }).then((res) => {//console.log("p1") ;  
    if(image!=null)
  res.json();
  setImage("")
}).then((data) => {/* eslint-disable */console.log(...oo_oo(`32cf8de7_4`,data));})
}


return (
<div className="d">
{value===''||value===null?<>
<div>
    <center  className="cent" style={{padding:'150px',height:'100vh',ba}}>
       
      <GoogleIcon sx={{fontSize:'100px' ,backgroundColor:'green',border:'8px solid grey',borderRadius:'50px',color:'orange'}} onClick={handleClick} className="logo"/>
      
      </center>

  </div>




























</>:
<>
<div class="modal fade" id="exampleModal" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
  <div class="modal-dialog" role="document">
    <div class="modal-content">
      <div class="modal-header" style={{backgroundColor:'black',color:'black'}}>
        <h5 class="modal-title" id="exampleModalLabel" >Update Your Comment </h5>
        
      </div>
      <div class="modal-body" >
        
      <input style={{padding:'10px'}}
              type="text"
              className="add-todo-input"
              onChange={(e) => setupdates(e.target.value)}
              value={updates}
              placeholder="update comment only once at a time...."
              
            />
              
        { updates===""   ? "":
            <div className="update button" style={{padding:'10px',margin:'10px',color:'white',width:'250px'}} onClick={() => {
              /* eslint-disable */console.log(...oo_oo(`32cf8de7_5`,date));update(date)}}>
             <button type="button" class="close" data-dismiss="modal" aria-label="Close" >
             Update Comment
        </button>
              
            </div>
}
        
       
      </div>
     
    </div>
  </div>
</div>
    
